using System;
using System.Collections.Generic;
using System.Drawing;
using System.Threading.Tasks;
using System.Windows.Forms;
using WebtoonDownloader_CapstoneProject.Core;

namespace WebtoonDownloader_CapstoneProject.UI.Forms
{
	public partial class WebtoonSearchForm : Form
	{
		private Pen lineDrawer = new Pen( GlobalVar.ThemeColor );
		public string urlSelected;
		private string searchString;

		public WebtoonSearchForm( string searchString )
		{
			InitializeComponent( );

			this.SetStyle( ControlStyles.OptimizedDoubleBuffer | ControlStyles.ResizeRedraw, true );
			this.UpdateStyles( );

			this.Opacity = 0;

			if ( !string.IsNullOrEmpty( searchString ) )
				this.searchString = searchString;
		}

		private void WebtoonSearchForm_Load( object sender, EventArgs e )
		{
			Animation.UI.FadeIn( this );

			string gifImageHTML = @"
			<html>
				<head>
					<style>
						html, body {
							margin: 0;
							width: 100%;
							height: 100%;
						}
					</style>
				</head>
				<body>
<img src='data:image/gif;base64,' />		
</html>";

			this.LOADING_GIFIMAGE.DocumentText = "0";
			this.LOADING_GIFIMAGE.Document.OpenNew( true );
			this.LOADING_GIFIMAGE.Document.Write( gifImageHTML );
			this.LOADING_GIFIMAGE.Refresh( );
			this.LOADING_GIFIMAGE.Visible = false;

			if ( !string.IsNullOrEmpty( searchString ) )
			{
				this.SEARCH_TEXTBOX.Text = searchString;
				this.SEARCH_BUTTON_Click( null, EventArgs.Empty );
			}
		}

		private void WebtoonSearchForm_Paint( object sender, PaintEventArgs e )
		{
			int w = this.Width, h = this.Height;

			e.Graphics.DrawLine( lineDrawer, 0, 0, w, 0 ); // 위
			e.Graphics.DrawLine( lineDrawer, 0, 0, 0, h ); // 왼쪽
			e.Graphics.DrawLine( lineDrawer, w - lineDrawer.Width, 0, w - lineDrawer.Width, h ); // 오른쪽
			e.Graphics.DrawLine( lineDrawer, 0, h - lineDrawer.Width, w, h - lineDrawer.Width ); // 아래
		}

		private bool APP_TITLE_BAR_BeginClose( )
		{
			return true;
		}

		private void SetUIStatus( bool status )
		{
			if ( status )
			{
				if ( this.InvokeRequired )
				{
					this.Invoke( new Action( ( ) =>
					{
						this.SEARCH_TEXTBOX_TITLE.Visible = true;
						this.SEARCH_TEXTBOX.Visible = true;
						this.SEARCH_BUTTON.Enabled = true;
						this.SEARCH_BUTTON.ButtonText = "웹툰 검색";
						this.SEARCH_LOADING_LABEL.Visible = false;
						this.LOADING_GIFIMAGE.Visible = false;
						this.SEARCH_RESULT_LIST.Enabled = true;
					} ) );
				}
				else
				{
					this.SEARCH_TEXTBOX_TITLE.Visible = true;
					this.SEARCH_TEXTBOX.Visible = true;
					this.SEARCH_BUTTON.Enabled = true;
					this.SEARCH_BUTTON.ButtonText = "웹툰 검색";
					this.SEARCH_LOADING_LABEL.Visible = false;
					this.LOADING_GIFIMAGE.Visible = false;
					this.SEARCH_RESULT_LIST.Enabled = true;
				}
			}
			else
			{
				if ( this.InvokeRequired )
				{
					this.Invoke( new Action( ( ) =>
					{
						this.SEARCH_TEXTBOX_TITLE.Visible = false;
						this.SEARCH_TEXTBOX.Visible = false;
						this.SEARCH_BUTTON.Enabled = false;
						this.SEARCH_BUTTON.ButtonText = "웹툰 검색 중 ...";
						this.SEARCH_LOADING_LABEL.Visible = true;
						this.LOADING_GIFIMAGE.Visible = true;
						this.SEARCH_RESULT_LIST.Enabled = false;
					} ) );
				}
				else
				{
					this.SEARCH_TEXTBOX_TITLE.Visible = false;
					this.SEARCH_TEXTBOX.Visible = false;
					this.SEARCH_BUTTON.Enabled = false;
					this.SEARCH_BUTTON.ButtonText = "웹툰 검색 중 ...";
					this.SEARCH_LOADING_LABEL.Visible = true;
					this.LOADING_GIFIMAGE.Visible = true;
					this.SEARCH_RESULT_LIST.Enabled = false;
				}
			}
		}

		private void WebtoonSelected( string url, bool[ ] metaData )
		{
			if ( metaData[ 1 ] )
			{
				NotifyBox.Show( this, "미성년자 관람 불가 웹툰", "Adult Webtoon", "미성년자 관란 불가 웹툰은 다운로드 하실 수 없습니다.", NotifyBox.NotifyBoxType.OK, NotifyBox.NotifyBoxIcon.Warning );
				return;
			}

			if ( metaData[ 0 ] )
			{
				NotifyBox.Show( this, "스토어 웹툰", "Store Webtoon", "스토어에 등록된 웹툰은 전체 다운로드가 되지 않을 수 있습니다.", NotifyBox.NotifyBoxType.OK, NotifyBox.NotifyBoxIcon.Warning );
			}

			this.urlSelected = url;
			Animation.UI.FadeOut( this, true );
		}

		private void SEARCH_BUTTON_Click( object sender, EventArgs e )
		{
			string name = this.SEARCH_TEXTBOX.Text;

			if ( name.Length <= 0 )
			{
				NotifyBox.Show( this, "검색 오류", "Search Error", "검색할 웹툰의 이름을 입력하세요.", NotifyBox.NotifyBoxType.OK, NotifyBox.NotifyBoxIcon.Warning );
				return;
			}

			this.SEARCH_RESULT_LIST.Controls.Clear( );
			this.SEARCH_LOADING_LABEL.Text = "'" + name + "'을 포함하는 웹툰을 검색하고 있습니다 ...";

			SetUIStatus( false );

			this.NO_RESULT_ICON.Visible = false;
			this.NO_RESULT_TITLE.Visible = false;
			this.NO_RESULT_DESC.Visible = false;
			this.WEBTOON_SEARCH_COUNT_LABEL.Visible = false;

			Task.Factory.StartNew( async ( ) =>
			{
				try
				{
					List<NaverWebtoon.WebtoonSearchResultList> result = NaverWebtoon.SearchWebtoonByTitle( name );

					await Task.Delay( 1000 );

					int y = 0;

					if ( result.Count > 0 )
					{
						foreach ( NaverWebtoon.WebtoonSearchResultList data in result )
						{
							WebtoonSearchListChildForm panel = new WebtoonSearchListChildForm( )
							{
								Location = new Point( 0, y )
							};
							panel.Initialize( data );
							panel.SelectWebtoon += WebtoonSelected;

							y += panel.Height + 5;

							if ( this.InvokeRequired )
								this.Invoke( new Action( ( ) => this.SEARCH_RESULT_LIST.Controls.Add( panel ) ) );
							else
								this.SEARCH_RESULT_LIST.Controls.Add( panel );
						}

						if ( this.InvokeRequired )
						{
							this.Invoke( new Action( ( ) =>
							{
								this.WEBTOON_SEARCH_COUNT_LABEL.Visible = true;
								this.WEBTOON_SEARCH_COUNT_LABEL.Text = result.Count + "개의 검색 결과가 있습니다.";
							} ) );
						}
						else
						{
							this.WEBTOON_SEARCH_COUNT_LABEL.Visible = true;
							this.WEBTOON_SEARCH_COUNT_LABEL.Text = result.Count + "개의 검색 결과가 있습니다.";
						}
					}
					else
					{
						if ( this.InvokeRequired )
						{
							this.Invoke( new Action( ( ) =>
							{
								this.NO_RESULT_ICON.Visible = true;
								this.NO_RESULT_TITLE.Visible = true;
								this.NO_RESULT_DESC.Visible = true;

								this.NO_RESULT_DESC.Text = "'" + name + "'을 포함하는 웹툰이 없습니다 ...";
							} ) );
						}
						else
						{
							this.NO_RESULT_ICON.Visible = true;
							this.NO_RESULT_TITLE.Visible = true;
							this.NO_RESULT_DESC.Visible = true;

							this.NO_RESULT_DESC.Text = "'" + name + "'을 포함하는 웹툰이 없습니다 ...";
						}
					}
				}
				finally
				{
					SetUIStatus( true );
				}
			} );
		}

		private void SEARCH_RESULT_LIST_Paint( object sender, PaintEventArgs e )
		{
			int w = this.SEARCH_RESULT_LIST.Width, h = this.SEARCH_RESULT_LIST.Height;

			e.Graphics.DrawLine( lineDrawer, 0, 0, w, 0 ); // 위
		}

		private void SEARCH_RESULT_LIST_Scroll( object sender, ScrollEventArgs e )
		{
			this.SEARCH_RESULT_LIST.Invalidate( );
		}

		private void SEARCH_TEXTBOX_KeyPress( object sender, KeyPressEventArgs e )
		{
			if ( e.KeyChar == ( char ) Keys.Enter )
			{
				this.SEARCH_BUTTON_Click( null, EventArgs.Empty );
				e.Handled = true; // 엔터 칠때 띵 소리가 나지 않게 함
			}
		}
	}
}
